            ["onInteract"] = "local BlockPlayer = require \"actions/BlockPlayer\"\nlocal Do = require \"actions/Do\"\nlocal MessageBox = require \"actions/MessageBox\"\n\nreturn function(self)\n    GameState:grantItem(require(\"data/items/YellowLeaf\"), 1)\n    return BlockPlayer {\n        Do(function() self:remove() end),\n        MessageBox {\n            message = \"You received a Yellow Leaf!\",\n            sfx = \"levelup\",\n            textSpeed = 7\n        }\n    }\nend",
            ["onPuzzleSolve"] = "local Ease = require \"actions/Ease\"\nlocal Parallel = require \"actions/Parallel\"\n\nreturn function(self)\n    self.sprite.color = {512,512,512,0}\n    self.hidden = false\n\n    return Parallel {\n        Ease(self.sprite.color, 1, 255, 1),\n        Ease(self.sprite.color, 2, 255, 1),\n        Ease(self.sprite.color, 3, 255, 1),\n        Ease(self.sprite.color, 4, 255, 1)\n    }\nend\n",
