          end),\n            Ease(sprites.sonic, \"y\", sprites.sonic.y + 300, 5),\n            Ease(sprites.sally, \"y\", sprites.sally.y + 300, 5),\n            Ease(sprites.antoine, \"y\", sprites.antoine.y + 300, 5)\n        },\n        Do(function()\n            self.scene:changeScene{map=\"ironlock1_door4\", fadeOutSpeed=0.3, fadeInSpeed=0.3}\n        end)\n    }\nend",
